import './MessageFrame.css';

function MessageFrame() {
    return(
        <div className="messageFrame__con">
            <div className="messageFrame__warning">
                <p>FINN.no forbeholder seg retten til å kontrollere og stoppe meldinger.</p>
            </div>
            <hr/>
            <div className="messageFrame__messages">
                <ul></ul>
            </div>
            <div className="messageFrame__textField bg-light">
                <div><i class="fas fa-paperclip fa-lg"></i></div>
                <input type="" placeholder="Skriv en melding" className="textField__text form-control"></input>
                <div><i class="fas fa-paper-plane fa-lg"></i></div>
            </div>
        </div>
    )
}

export default MessageFrame;
